import React from "react";
import styled from "styled-components";
import Hello from "../components/Home/Hello";
import AboutMe from "../components/Home/AboutMe";
import Project from "../components/Home/Project";
import Storage from "../components/Home/Storage";
import Github from "../components/Home/Github";
import Study from "../components/Home/Study";

const Background = styled.div`
  width: 100vw; /* Viewport의 100% 너비 */
  min-height: 100vh; /* 최소 높이를 100vh로 설정 */
  /*background: #fdfbf8;*/
  background: #e29f91;

  display: flex; /* Flexbox로 정렬 */
  justify-content: center; /* Box를 수평 중앙 정렬 */
  align-items: center; /* Box를 수직 중앙 정렬 */
`;

const Box = styled.div`
  width: 1440px;
  height: 850px;
  background: #fdfbf8;

  display: flex; /* Flexbox 활성화 */
  justify-content: space-between; /* Left는 왼쪽 끝, Right는 오른쪽 끝으로 배치 */
  align-items: center; /* 수직 가운데 정렬 */

  border: 1px solid black;
  box-sizing: border-box;
`;

const Left = styled.div`
  width: 200px;
  height: 100%;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Right = styled.div`
  width: 200px;
  height: 100%;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Top = styled.div`
  height: 60px;
  width: 1040px;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Content = styled.div`
  height: 715px;
  width: 1040px;

  border: 1px solid black;
  box-sizing: border-box;
`;

const Bottom = styled.div`
  height: 75px;
  width: 1040px;

  border: 1px solid black;
  box-sizing: border-box;
`;

const ItemsContainer = styled.div`
  display: flex; /* Flexbox로 정렬 */
  flex-direction: column; /* 세로 정렬 */
  gap: 40px; /* Hello와 AboutMe 사이 간격 설정 */
`;

const ContentLayout = styled.div`
  display: flex; /* 수평 정렬 */
  align-items: flex-start; /* 수직 정렬 (필요에 따라 조정 가능) */

  gap: 40px; /* ItemsContainer와 Project 사이 간격 */
`;

const ContentLayout2 = styled.div`
  display: flex; /* 수평 정렬 */
  align-items: flex-start; /* 수직 정렬 (필요에 따라 조정 가능) */
  gap: 40px; /* ItemsContainer와 Project 사이 간격 */
  margin-top: 40px;
`;

export default function Home() {
  return (
    <Background>
      <Box>
        <Left></Left>
        <div>
          <Top></Top>
          <Content>
            <ContentLayout>
              <ItemsContainer>
                <Hello />
                <AboutMe />
              </ItemsContainer>
              <Project />
            </ContentLayout>
            <ContentLayout2>
              <Storage></Storage>
              <Github></Github>
              <Study></Study>
            </ContentLayout2>
          </Content>
          <Bottom></Bottom>
        </div>
        <Right></Right>
      </Box>
    </Background>
  );
}
